import "./App.css";
import AddProfileForm from "./components/FormAddProfiles/AddProfileForm";
import AddBookForm from "./components/FormAddBook/AddBookForm";
import Repo from "./components/Repo/Repo";
import Profiles from "./components/Profiles/Profiles";

function App() {

  return (
    <div className="App">
      <AddBookForm />
      <AddProfileForm />
      <Repo />
      <Profiles />
    </div>
  );
}

export default App;
